A defining feature of cross chain apps (xDapps) is the ability to move tokens from one chain to another. Wormhole’s APIs make that a breeze. To demonstrate, let’s do a simple programmatic transfer from Eth to Solana. First, determine the address on Solana where we're sending the tokens. Unlike EVM chains where the wallet address is used, we need to send the tokens to the recipient address associated token account for that token. We can use helper functions from the Wormhole SDK to make this possible. import { Token, ASSOCIATED_TOKEN_PROGRAM_ID, TOKEN_PROGRAM_ID
} from '@solana/spl-token';
import { getForeignAssetSolana, hexToUint8Array, nativeToHexString, CHAIN_ID_ETH,
} from '@certusone/wormhole-sdk'; const SOLANA_TOKEN_BRIDGE_ADDRESS = "wormDTUJ6AWPNvk59vGQbDvGJmqbDTdgWgAqcLBCgUb";
// determine destination address - an associated token account
const solanaMintKey = new PublicKey( (await getForeignAssetSolana( connection, SOLANA_TOKEN_BRIDGE_ADDRESS, CHAIN_ID_ETH, hexToUint8Array(nativeToHexString(tokenAddress, CHAIN_ID_ETH) || "") )) || ""
);
const recipientAddress = await Token.getAssociatedTokenAddress( ASSOCIATED_TOKEN_PROGRAM_ID, TOKEN_PROGRAM_ID, solanaMintKey, recipientWalletAddress
); After we have the receipt token account on Solana, submit the transfer message on Ethereum. This will output a log that contains a sequence number (a nonce for the message) and an emitter address (the ETH Token Bridge Address as bytes). The sequence number and emitter address will be used to fetch a VAA after it’s been signed by Guardians. import { trasnferFromEth, parseSequenceFromLogEth, getEmitterAddressEth, CHAIN_ID_SOLANA,
} from '@certusone/wormhole-sdk'; const ETH_TOKEN_BRIDGE_ADDRESS = "0x3ee18B2214AFF97000D974cf647E7C347E8fa585"; // Submit transaction - results in a Wormhole message being published
const receipt = await transferFromEth( ETH_TOKEN_BRIDGE_ADDRESS, signer, tokenAddress, amount, CHAIN_ID_SOLANA, recipientAddress
);
// Get the sequence number and emitter address required to fetch the signedVAA of our message
const sequence = parseSequenceFromLogEth(receipt, ETH_BRIDGE_ADDRESS);
const emitterAddress = getEmitterAddressEth(ETH_TOKEN_BRIDGE_ADDRESS); Once the Guardians have signed the token message, fetch it to use in the redeem step. If you’re a developer, you might run this as an automatic process through an application specific relayer (more on that in a later section). import { getSignedVAA,
} from '@certusone/wormhole-sdk'; // Fetch the signedVAA from the Wormhole Network (this may require retries while you wait for confirmation)
const { signedVAA } = await getSignedVAA( WORMHOLE_RPC_HOST, CHAIN_ID_ETH, emitterAddress, sequence
); Now, post the VAA to Solana to mint the tokens. Because of the compute limit on Solana, we split the signature verification and token claim into steps. To do that, verify all the signatures and create a claim account for the token. const SOL_BRIDGE_ADDRESS = "worm2ZoG2kUd4vFXhvjh93UUH596ayRfgQ2MgjNMTth";
