await postVaaSolana( connection, // Solana Mainnet Connection wallet, //Solana Wallet Signer SOL_BRIDGE_ADDRESS, payerAddress, signedVAA
); Finally, claim the tokens: // Finally, redeem on Solana
const transaction = await redeemOnSolana( connection, SOL_BRIDGE_ADDRESS, SOL_TOKEN_BRIDGE_ADDRESS, payerAddress, signedVAA, isSolanaNative, mintAddress
);
const signed = await wallet.signTransaction(transaction);
const txid = await connection.sendRawTransaction(signed.serialize());
await connection.confirmTransaction(txid);

