Fetch the fee schedule for the Portal Token Bridge relayer. This fee schedule outlines the minimum fee for each recipient chain that the relayer will accept. As long as we attach at least that fee in the relayer fee, we can be fairly confident that the relayer will pick up the transaction and relay it to the recipient chain. The fee will cover the gas cost for the relayer along with a little extra to make it worth their time to run the relayer service. We will also define the transfer amount in this step. The fee schedule will either return a flat fee in USD for the recipient chain, or a percentage fee (usually only for Ethereum). Either way, we’ll need to calculate the fee in in BigNumber format (no decimals). For example, 1 MATIC on Polygon is 1e18 wei, or 1000000000000000000 wei. Because EVM has a hard time with floating point math, we have to do all our transactions in this small unit, to avoid decimal numbers. const transferAmount = BigNumber.from("1000000000000000000"); // We are sending 1 MATIC over the wall to Oasis
const relayerFeeSchedule = await (await fetch( "https://raw.githubusercontent.com/certusone/wormhole-relayer-list/main/relayer.json"
)).json(); The fee schedule has the following interface: export interface RelayerFeeSchedule { supportedTokens: ChainAddress[]; relayers: Relayer[]; feeSchedule: FeeSchedule;
} interface ChainAddress { chainId: number; address: string; coingeckoId: string;
} interface Relayer { name: string; url: string;
} interface FeeSchedule { [chainId: string]: { type: "flat" | "percent"; feeUsd?: number; feePercent?: number; gasEstimate?: number; };
} After fetching the fee schedule, find the fee in wei that needs to be paid to the Relayer. At the time of writing, Oasis has a flat fee of $0.50, so to calculate how much MATIC we need to pay for the $0.50 fee, we need to fetch the MATIC price. To do that, use the free CoinGecko api: let feeWei: number;
if (relayerFeeSchedule.feeSchedule[CHAIN_ID_OASIS].type == "flat") { const feeUsd = relayerFeeSchedule.feeSchedule[CHAIN_ID_OASIS].feeUsd const MATIC_PRICE = ( await ( await fetch( "https://api.coingecko.com/api/v3/simple/token_price/polygon-pos?contract_addresses=0x0d500b1d8e8ef31e21c99d1db9a6444d3adf1270&vs_currencies=usd" ) ).json() )["0x0d500b1d8e8ef31e21c99d1db9a6444d3adf1270"]["usd"]; feeWei = (feeUsd / MATIC_PRICE) * 1e18;
} else if (relayerFeeSchedule.feeSchedule[CHAIN_ID_OASIS].type == "percent") { let feeWei = (relayerFeeSchedule.feeSchedule[CHAIN_ID_OASIS].feePercent /100) * transferAmount.toNumber();
}

